import React from 'react';

class User extends React.Component {
    render() {
        return (
            <div> NEW REACT LESSON </div>
        )
    }





    userList() {
        fetch('users').then(function(data){
            return data.json();
        }).then( json => {
            this.setState({
                employee: json
            });
            console.log(json);
        });
    }
}

export default User;
